informacaoComplementar:
O objeto desta contratação não se enquadra como sendo de luxo, em atenção à vedação constante no art. 20 da Lei nº 14.133/2021 e art. 73 e inc. 1 do art. 74 do Decreto Distrital nº 44.330/2023;

Os serviços objeto desta contratação, embora de alta complexidade, podem ser caracterizados como comuns para os fins do art. 74 do Decreto Distrital nº 44.330/2023, em virtude da sua natureza essencial e da existência de protocolos clínicos e diretrizes terapêuticas estabelecidas para grande parte dos procedimentos de cirurgia geral, o que permite a definição de padrões de atendimento e a comparação objetiva entre diferentes prestadores.

A presente contratação possui caráter continuado, tendo em vista a natureza essencial e permanente do atendimento de cirurgia geral, à população usuária do SUS, bem como a necessidade de manutenção ininterrupta da assistência, diante da demanda crescente e da insuficiência de oferta na rede própria da SES/DF.

A presente contratação se formalizará a partir de termo contratual (art. 95 da Lei nº 14.133/2021);

Vigência Contratual: a vigência da contratação é de 12 (doze) meses, contados a partir da assinatura do contrato, PRORROGÁVEL por até 120 (cento e vinte) meses, na forma dos artigos 105 a 107 da Lei n° 14.133, de 2021

O contrato oferece maior detalhamento das regras que serão aplicadas em relação às obrigações da contratada e contratante.
